import React , {useState} from 'react';
import FilterGallery from './FilterGallery';
import SecondFilterGallery from './SecondFilterGallery';




function Games_Page(){

    const [Gclick , SetGclick] = useState(false);
    const [Hclick , SetHclick] = useState(false);

    function changev(){
        SetGclick (true);
    }

    function changeb(){
        SetHclick(true)
    }
    return(
        <>
            <div className='button-container'>
                <button onClick={changev} className='btn btn-danger my-5 mx-5 p-3'>Get Weapon NFT</button>
                <button onClick={changeb} className='btn btn-danger my-5 mx-5 p-3'>Get Armour NFT</button>
            </div>
            
            {Gclick && <FilterGallery/>}
            {!Gclick && <SecondFilterGallery/>}

        </>
    )
}

export default Games_Page;
